import React from "react";

const Catogreis = () => {
  const FilterCatogries = ["All", "Photos", "illustration", "vectors"];


  const activefun = (data) =>{
    data.classList.add("Active-filter");
  }
  return (
    <>
      <div className="filter-catogries">
        {FilterCatogries.map((filter) => {
          return (
            <>
              <div className="filter-cat-name " onClick={()=>activefun(filter)}>{filter}</div>
            </>
          );
        })}

        
      </div>
    </>
  );
};

export default Catogreis;
